Is there a query which would concatenate deep sub-lists?<p>In my database, I have a list of documents, and each of these documents contains itself another list of documents, the latter being a list of some data with timestamps stored as millis since epoch. </p>

<p>Following is the sample data set:</p>

<pre><code>{
    "_id" : ObjectId("5da5aee33e791547bb418782"),
    "list1" : [
        {
            "document" : {
                "list2" : [
                    {
                        "sub-document" : {
                            "timestamp" : 100
                        }
                    },
                    {
                        "sub-document" : {
                            "timestamp" : 105
                        }
                    },
                    {
                        "sub-document" : {
                            "timestamp" : 110
                        }
                    }
                ]
            }
        },
        {
            "document" : {
                "list2" : [
                    {
                        "sub-document" : {
                            "timestamp" : 101
                        }
                    },
                    {
                        "sub-document" : {
                            "timestamp" : 104
                        }
                    },
                    {
                        "sub-document" : {
                            "timestamp" : 109
                        }
                    }
                ]
            }
        }
    ]
}

</code></pre>

<p><strong>Is it possible to query, for instance, 2 latest documents from all the "second-layer" lists?</strong> </p>

<p>The expected output is:</p>

<pre><code>[
    {
        "sub-document": {
            "timestamp": 109
        }
    },
    {
        "sub-document": {
            "timestamp": 110
        }
    }
]
</code></pre>

