Meteor update with $push to an array that doesn't already exist on a single record<p>I have been through as many of the answers here on StackOverflow but am still having an issue.</p>

<p>First I don't get any errors in the console on the client or in the terminal console. The return says success yet it does not update.</p>

<p>I'm using a method on the SERVER as follows:</p>

<pre><code>import { Meteor } from 'meteor/meteor';
import { Mongo } from 'meteor/mongo';

Meteor.methods({
   'agentPageAccess'({userID, pageID}) {
      Pages.update({ "PageID" : pageID }, {
        $push: { "agentAccess" : { "agentID" : userID } }
      });   
    }
});
</code></pre>

<p>Here is the data before the update is called. Note: the array does not exist and I want it to be added and the data updated in that new array, only if the array does not already exist. If the array does already exist I want it to push the new value to the end of the existing array.</p>

<pre><code>{ "_id" : "pPvQezHxC4J4tkGQg", "PageID" : "1234567", "PageName" : "Test Page", "PageToken" : "7654321" }
</code></pre>

<p>I have checked to make sure the userID and pageID have a value when the method is fired.</p>

<p>Here is the method call on the CLIENT Side:</p>

<pre><code>Template.assignAgents.events({
        'submit form': function(event) {
            event.preventDefault();
            let target = event.target;
            let userID = target.userSelect.value;
            let pageID = target.Page.value;

            Meteor.call('agentPageAccess', {
                userID: userID,
                pageID: pageID
            }, (err,res) =&gt; {
                if(err){
                    alert(err);
                }else{
                    alert("Agent assigned to page");
                }
            });
        }
    });
</code></pre>

<p>I'm a old programmer with many years of experience but new to Meteor. So please talk like I'm new to this platform. Thanks so much for all your help!!</p>

