<p>already tried the {$set: email, password}</p>

<pre><code>    const id = { _id: req.params.id };
    const { email, password } = req.body;

    let user = await User.findByIdAndUpdate(id, { email, password });

    if (!user) {
        return res.json({ message: "error"});
    }

    return res.json({
        user: user,
        updated: true
    })
</code></pre>

