MongoDB aggregation framework to join by id two faceted collections<p>I have the following document (result of a <code>$facet</code>):</p>

<pre><code>{
  "productProperties": [
    {
     "productId": "1"
     "productProperty": "AAA"
    },
    {
      "productId": "2"
      "productProperty": "BBB"
    },
    {
      "productId": "3"
      "productProperty": "CCC"
    }
  ],
  "productRelations": [
    {
      "productId": "1",
      "relatedProducts": [
        {
          "productId": "2",
          "relationProperty": 222
        },
        {
          "productId": "3",          
          "relationProperty": 333
        }
      ]
    },
    {
      "productId": "2",
      "relatedProducts": [
        {
          "productId": "1",
          "relationProperty": 111
        }
      ]
    }      
  ]  
}
</code></pre>

<p>From the previous document and using MongoDb aggregation framework I want to build a collection enriching <code>productRelations</code> with <code>productProperties</code>.</p>

<p>This is, I want to add for each product the property <code>productProperty</code>. Note that the property is not added only in the root element, but also in each related product:</p>

<pre><code>[
  {
    "productId": "1",
    "productProperty": "AAA",
    "relatedProducts": [
      {
        "productId": "2",
        "productProperty": "BBB",
        "relationProperty": 222
      },
      {
        "productId": "3",
        "productProperty": "CCC",      
        "relationProperty": 333
      }
    ]
  },
  {
    "productId": "2",
    "otherField": "BBB",
    "relatedProducts": [
      {
        "productId": "1",
        "productProperty": "AAA",
        "relationProperty": 111
      }
    ]
  }
]
</code></pre>

<p>I tried to use <code>$lookup</code>, but it only works with other collections and I want to do this aggregation in situ.</p>

<p>Thanks in advance!</p>

