Why does the "distinct" and "count" commands happen so slowly on indexed items in MongoDB?<p>I am using MongoDB (Atlas) to hold my ~55 million time-series documents in a database</p>

<p>The documents typically look like this:</p>

<pre><code>{
  "_id" :          ObjectId("5c8f1fb127fcc613f422677d"),
  "capture_time" : ISODate("2019-03-18T04:33:51Z"),
  "key" :          "9727eec91/51c922a.png",
  "e_id" :         20702
}
</code></pre>

<p>Not all documents have an 'e_id', so I have indexed "e_id" like so:</p>

<pre><code>{
    "v" : 2,
    "key" : {
        "e_id" : 1
    },
    "name" : "e_id_1",
    "ns" : "events.detection_events",
    "partialFilterExpression" : {
        "e_id" : {
            "$exists" : true
        }
    }
}
</code></pre>

<p>As you can see I've got a partial index on the "e_id". </p>

<p>When I run <code>db.coll.count({"e_id": {$exists:true}})</code>, the response times out and I get warnings about disk IO reaching 90%</p>

<p>The same thing happens when I run <code>db.coll.distinct("e_id", {"e_id": {$exists:true}})</code>.</p>

<p>If I run <code>db.coll.find({"e_id": {$exists:true}})</code> it runs reasonable quickly.</p>

<p>Do I just have too many Documents in this collection to be able to count/distinct them based on "e_id"?</p>

<p><strong>EDIT</strong></p>

<p>Here is the .explain() from the db.coll.find({"e_id": {$exists: true}}) query</p>

<pre><code>{
    "queryPlanner" : {
        "plannerVersion" : 1,
        "namespace" : "db.coll",
        "indexFilterSet" : false,
        "parsedQuery" : {
            "e_id" : {
                "$exists" : true
            }
        },
        "winningPlan" : {
            "stage" : "FETCH",
            "filter" : {
                "e_id" : {
                    "$exists" : true
                }
            },
            "inputStage" : {
                "stage" : "IXSCAN",
                "keyPattern" : {
                    "e_id" : 1
                },
                "indexName" : "emp_id_1",
                "isMultiKey" : false,
                "multiKeyPaths" : {
                    "e_id" : [ ]
                },
                "isUnique" : false,
                "isSparse" : false,
                "isPartial" : true,
                "indexVersion" : 2,
                "direction" : "forward",
                "indexBounds" : {
                    "e_id" : [
                        "[MinKey, MaxKey]"
                    ]
                }
            }
        },
        "rejectedPlans" : [ ]
    },
    "serverInfo" : {
        "host" : "cluster0.mongodb.net",
        "port" : 29017,
        "version" : "4.0.12",
        "gitVersion" : "5776e76dbf9e7afe86e6b39g22520ffb6766e95d4"
    },
    "ok" : 1,
    "operationTime" : Timestamp(1571177083, 2),
    "$clusterTime" : {
        "clusterTime" : Timestamp(1571177083, 2),
        "signature" : {
            "hash" : BinData(0,"fvD6+eR72y83kO15Tk3TAmZtn5I="),
            "keyId" : NumberLong("6728051106256797217")
        }
    }
}
</code></pre>

