fetch query returning empty array when using params<p>I'm trying to fetch some values from a mongodb collection using lucid-mongo, and it's returning me an empty array. The functions are essentially copied from others I have somewhere else in my code, just changing where some values are.</p>

<p>The params.id returns the same as auth.user._id, but somehow it doesn't work. I've also tried to input the id as a raw string and it also didn't work.</p>

<pre><code>//these two functions work normally
async getMonths({ auth }) {
    const day = await Day.query()
      .where({
        userId: auth.user._id
      })
      .first();

    return day;
  }
  async showMonth({ request, auth }) {
    let { date } = request.only(["date"]);

    const day = await Day.query()
      .where({
        userId: auth.user._id,
        date: date
      })
      .fetch();
    return day;
  }
//these two return me an empty array (notice they're basically the same)
  async showMonthGestor({ request, auth, params }) {
    let { date } = request.only(["date"]);

    const day = await Day.where({
      userId: params.id,
      date: date
    }).fetch();
    console.log(params.id);
    return day;
  }
  async showGestor({ auth, params }) {
    const day = await Day.query()

      .where({ userId: params.id })
      .fetch();
    console.log(day);
    return day;
  }
</code></pre>

<p>As per request here are the routes for the functions:</p>

<pre><code>//these ones work fine
Route.post("/history", "DayController.show").middleware(["auth"]);

Route.post("/history/permonth", "DayController.showMonth").middleware(["auth"]);
//these do not (middleware "gestor" only checks if the value of "userType" 
//in auth.user is "gestor" and returns a 401 if not)
Route.post("/history/:id", "DayController.showGestor").middleware([
  "auth",
